// src/components/Navbar.jsx
import React from 'react';
import { Link } from 'react-router-dom';
import { FaBullseye } from 'react-icons/fa';

const Navbar = () => {
  return (
    <nav className="flex items-center justify-between px-6 py-4 bg-white shadow sticky top-0 z-50">
      <div className="flex items-center space-x-2 text-purple-700 font-bold text-xl">
        <FaBullseye className="text-2xl" />
        <span>Fundraising Portal</span>
      </div>
      <div className="space-x-4">
        <Link to="/login" className="text-blue-600 hover:underline">Login</Link>
        <Link to="/dashboard" className="text-blue-600 hover:underline">Dashboard</Link>
        <Link to="/leaderboard" className="text-blue-600 hover:underline">Leaderboard</Link>
      </div>
    </nav>
  );
};

export default Navbar;
